import React from "react";
import Navbar from "./Navbar";

const Home = () => {
  return (
    <>
      <section id="header" className="section">
        <div className="container-fluid nav_bg">
          <div className="row">
            <div className="col-10 mx-auto">

                <div className="col-md-6 pt-5 pt-lg-0 order-2 order-lg-1">
                    <h1>Hire some of the efficients ninjas from <strong>Konoha</strong></h1>
                    <h2 className="my-2">We provide the best ninjas for each ranked missions</h2>
                    <div className="mt-3">
                        <a href="">Hire them!</a>
                    </div>
                </div>

            </div>
          </div>
        </div>
        
      </section>
    </>
  );
};
export default Home;
